import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Login from './pages/Login';
import Chat from './pages/Chat';
function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact component={Chat} path="/"/>
        <Route exact component={Login} path="/login"/>
      </Switch>

    </BrowserRouter>

  );
}

export default App;
